import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import { GlobalStateProvider} from './utils/useGlobalState'
import Home from './components/home'
import GridEditor from './components/gridEditor'
import Login from './components/login'

function App() {
  return (
    <GlobalStateProvider>
      <Login/>
      <Router basename='/'>
        <Routes>
          <Route exact path="/" element={<Home/>} />
          <Route exact path="/new" element={<GridEditor/>} />
          {/*<Route exact path="/grid/:uid" component={GridViewer} />*/}
          <Route exact path="/grid/:uid/edit" element={<GridEditor/>} />
        </Routes>
      </Router>
    </GlobalStateProvider>
  );
}

export default App;
